import './Contact.css';
import image from '../assets/talktous_image.png';

const Contact = () => {
    return (

        <div>
            <div className='contact__container'>
                <div>
                    <div>
                        Talk to Us
                    </div>

                    <div className='contact__body'>
                    <div>
                                Send us an Email
                            </div>
                            <div>
                                hello@fundfolio.in
                            </div>
                        <div className='contact__body_box'>

                        </div>

                    </div>
                </div>

                <div>
                    <img src={image} alt="image" />
                </div>

            </div>

        </div>

    );
};

export default Contact;
